import React from 'react';
import {Button, Row, Col, Container} from 'react-bootstrap';
import './App.css';

let App = () => {
  return (
    <Container fluid>
      <Row className='my-auto'>
        <Col lg={12} className="text-center">
          <h1>DocTalk</h1>
          <h2>Your online medical appointments platform!</h2>
          <Button variant='info' classname="mt-3" href='#'>Sign In!</Button>
        </Col>
      </Row>
    </Container>
  );
}

export default App;
